import React, { useState } from "react";
import UserForm from "./components/Landing";
import "App.scss";
import { BrowserRouter as Router, Switch, Route, Link } from "react-router-dom";
function App() {
  return (
    <div className="App">
      <Router>
        <Switch>
          <Route path="/about">
            <About />
          </Route>
          <Route path="/users">
            <Users />
          </Route>
          <Route path="/">
            <UserForm />
          </Route>
        </Switch>
      </Router>
    </div>
  );
}

export default App;
